import React from "react";
import "./Header.css";

const Header = props => (

    <div className="header">
        <div className="title">Looney Tunes</div>
        <br></br>
        <div className="title">Memory Game!</div>
        <div className="score">
        <br></br>
        <div className="title">Don't click on the same character more than once or you lose!</div>
            Score: {props.score}
        </div>
        <br></br>
        <div className="highScore">
            High Score: {props.highscore}
        </div>
    </div>
);

export default Header;
